import TextField from'material-ui/TextField'
import RaisedButton from'material-ui/RaisedButton'

export class SecondStep extends Component {
  continue = e => {
    e.preventDefault()
    this.props.nextStep()
  }
  render() {
    return (
      <div>
        <h1>Hola Desde PAso 2</h1>
      </div>
    );
  }
